import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { FaBell, FaCog, FaSignOutAlt, FaUserCircle } from 'react-icons/fa';

const Dashboard = () => {
  const navigate = useNavigate();

  // State for user data
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Simulated API call to fetch user data
    setTimeout(() => {
      setUser({
        name: 'Jane Doe',
        email: 'jane.doe@example.com',
        profilePic: 'https://via.placeholder.com/100',
      });
    }, 1000);
  }, []);

  return (
    <div className="min-h-screen flex flex-col bg-gray-100 font-sans">
      {/* Navbar */}
      <nav className="bg-white shadow-md px-6 py-4 flex justify-between items-center">
        <h1 className="text-xl font-bold text-gray-800">My Dashboard</h1>
        <div className="flex items-center space-x-4">
          <FaBell className="text-gray-600 cursor-pointer text-xl" />
          <div className="relative group">
            <img
              src={user?.profilePic || 'https://via.placeholder.com/50'}
              alt="Profile"
              className="w-10 h-10 rounded-full border border-gray-300 cursor-pointer"
            />
            <div className="absolute right-0 mt-2 w-48 bg-white rounded-lg shadow-md hidden group-hover:block">
              <div className="px-4 py-2 border-b">
                <p className="text-gray-800 font-semibold">{user?.name || 'Guest'}</p>
                <p className="text-gray-500 text-sm">{user?.email || 'guest@example.com'}</p>
              </div>
              <ul>
                <li
                  className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center space-x-2"
                  onClick={() => navigate('/settings')}
                >
                  <FaCog /> <span>Account Settings</span>
                </li>
                <li
                  className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center space-x-2"
                  onClick={() => navigate('/logout')}
                >
                  <FaSignOutAlt /> <span>Logout</span>
                </li>
              </ul>
            </div>
          </div>
        </div>
      </nav>

      {/* Welcome Section */}
      <header className="bg-blue-500 text-white p-6 text-center">
        <h2 className="text-3xl font-semibold">Welcome, {user?.name || 'Guest'}!</h2>
        <p className="mt-2">Explore your dashboard and manage your activities efficiently.</p>
      </header>

      {/* Main Content */}
      <main className="flex-grow p-6">
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          {/* Clubs */}
          <Card
            title="Clubs"
            description="Join and manage your favorite clubs."
            onClick={() => navigate('/clubs')}
            bgColor="bg-green-500"
          />
          {/* Events */}
          <Card
            title="Events"
            description="Discover upcoming events and activities."
            onClick={() => navigate('/events')}
            bgColor="bg-purple-500"
          />
          {/* Resources */}
          <Card
            title="Resources"
            description="Access shared resources and materials."
            onClick={() => navigate('/resources')}
            bgColor="bg-yellow-500"
          />
        </div>
      </main>

      {/* Footer */}
      <footer className="bg-gray-800 text-gray-400 text-center py-4">
        Â© 2024 Your Platform | All rights reserved.
      </footer>
    </div>
  );
};

// Reusable Card Component
const Card = ({ title, description, onClick, bgColor }) => (
  <div
    onClick={onClick}
    className={`p-6 text-white rounded-lg shadow-md cursor-pointer hover:shadow-lg transform hover:-translate-y-1 transition ${bgColor}`}
  >
    <h3 className="text-2xl font-bold">{title}</h3>
    <p className="mt-2">{description}</p>
  </div>
);

export default Dashboard;
